import React from 'react';
import { Link } from 'react-router-dom';

export default function LandingPage() {
  return (
    <div className="landing-page min-vh-100 d-flex flex-column justify-content-center align-items-center text-center px-3">
      {/* Animated background elements */}
      <div className="background-circles">
        <div className="circle circle-1"></div>
        <div className="circle circle-2"></div>
        <div className="circle circle-3"></div>
      </div>
      
      {/* Main content */}
      <div className="content-container position-relative z-1">
        <h1 className="display-3 fw-bold mb-4 title-text">LivingLink</h1>
        
        <div className="tagline-container mb-4">
          <div className="tagline-line"></div>
          <p className="tagline mx-3 mb-0">Residential Society Management</p>
          <div className="tagline-line"></div>
        </div>
        
        <p className="lead mb-5 description-text" style={{ maxWidth: '650px' }}>
          Your residential society management made easy. Stay connected, pay fees,
          book facilities, submit complaints anonymously, track finances, and more - 
          all in one seamless platform.
        </p>
        
        {/* Feature highlights */}
        <div className="feature-highlights d-flex flex-wrap justify-content-center gap-4 mb-5">
          <div className="feature-item">
            <div className="feature-icon mb-2">üí≥</div>
            <p className="mb-0 small">Easy Payments</p>
          </div>
          <div className="feature-item">
            <div className="feature-icon mb-2">üè¢</div>
            <p className="mb-0 small">Facility Booking</p>
          </div>
          <div className="feature-item">
            <div className="feature-icon mb-2">üìù</div>
            <p className="mb-0 small">Anonymous Complaints</p>
          </div>
          <div className="feature-item">
            <div className="feature-icon mb-2">üìä</div>
            <p className="mb-0 small">Financial Tracking</p>
          </div>
        </div>
        
        {/* CTA Buttons */}
        <div className="cta-buttons">
          <Link to="/login" className="btn btn-primary btn-lg me-3 px-4 py-3">
            Get Started
          </Link>
          <Link to="/register" className="btn btn-outline-light btn-lg px-4 py-3">
            Create Account
          </Link>
        </div>
      </div>
      
      {/* Footer note */}
      <div className="position-absolute bottom-0 mb-3">
        <p className="small text-light opacity-75">Simplifying community living</p>
      </div>
      
      {/* Add CSS styles */}
      <style>{`
        :root {
          --color-dark-blue: #0D1B2A;
          --color-navy: #1B263B;
          --color-blue: #415A77;
          --color-light-blue: #778DA9;
          --color-off-white: #E0E1DD;
        }
        
        .landing-page {
          background: linear-gradient(135deg, var(--color-dark-blue) 0%, var(--color-navy) 100%);
          color: var(--color-off-white);
          position: relative;
          overflow: hidden;
        }
        
        .background-circles {
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
          overflow: hidden;
          z-index: 0;
        }
        
        .circle {
          position: absolute;
          border-radius: 50%;
          background: rgba(123, 141, 169, 0.1);
        }
        
        .circle-1 {
          width: 250px;
          height: 250px;
          top: -50px;
          left: -50px;
        }
        
        .circle-2 {
          width: 400px;
          height: 400px;
          bottom: -100px;
          right: -100px;
          background: rgba(65, 90, 119, 0.1);
        }
        
        .circle-3 {
          width: 150px;
          height: 150px;
          top: 50%;
          left: 70%;
          background: rgba(224, 225, 221, 0.05);
        }
        
        .title-text {
          background: linear-gradient(to right, var(--color-off-white), var(--color-light-blue));
          -webkit-background-clip: text;
          -webkit-text-fill-color: transparent;
          background-clip: text;
          text-shadow: 0 2px 10px rgba(0, 0, 0, 0.2);
          animation: fadeIn 1s ease-out;
        }
        
        .tagline-container {
          display: flex;
          align-items: center;
          justify-content: center;
          margin: 1.5rem 0;
        }
        
        .tagline-line {
          height: 1px;
          width: 50px;
          background: linear-gradient(90deg, transparent, var(--color-light-blue), transparent);
        }
        
        .tagline {
          color: var(--color-light-blue);
          font-weight: 400;
          letter-spacing: 2px;
          text-transform: uppercase;
          font-size: 0.9rem;
        }
        
        .description-text {
          line-height: 1.7;
          color: rgba(224, 225, 221, 0.9);
          font-weight: 300;
        }
        
        .feature-highlights {
          padding: 1.5rem 0;
        }
        
        .feature-item {
          background: rgba(27, 38, 59, 0.5);
          padding: 1rem 1.5rem;
          border-radius: 12px;
          border: 1px solid rgba(119, 141, 169, 0.2);
          transition: all 0.3s ease;
          width: 140px;
        }
        
        .feature-item:hover {
          transform: translateY(-5px);
          box-shadow: 0 10px 20px rgba(0, 0, 0, 0.2);
          border-color: var(--color-light-blue);
        }
        
        .feature-icon {
          font-size: 1.8rem;
        }
        
        .btn-primary {
          background: var(--color-blue);
          border: none;
          border-radius: 8px;
          font-weight: 500;
          transition: all 0.3s ease;
        }
        
        .btn-primary:hover {
          background: var(--color-light-blue);
          transform: translateY(-2px);
          box-shadow: 0 5px 15px rgba(65, 90, 119, 0.4);
        }
        
        .btn-outline-light {
          border-radius: 8px;
          border-width: 2px;
          font-weight: 500;
          transition: all 0.3s ease;
        }
        
        .btn-outline-light:hover {
          background: rgba(224, 225, 221, 0.1);
          transform: translateY(-2px);
          box-shadow: 0 5px 15px rgba(0, 0, 0, 0.2);
        }
        
        @keyframes fadeIn {
          from {
            opacity: 0;
            transform: translateY(20px);
          }
          to {
            opacity: 1;
            transform: translateY(0);
          }
        }
        
        .content-container {
          animation: fadeIn 1s ease-out 0.2s both;
        }
        
        /* Responsive adjustments */
        @media (max-width: 768px) {
          .tagline-container {
            flex-direction: column;
            gap: 10px;
          }
          
          .tagline-line {
            width: 100px;
          }
          
          .feature-highlights {
            gap: 15px;
          }
          
          .feature-item {
            width: 120px;
            padding: 0.8rem 1rem;
          }
          
          .cta-buttons {
            display: flex;
            flex-direction: column;
            gap: 15px;
          }
          
          .btn {
            width: 100%;
            margin: 0 !important;
          }
        }
      `}</style>
    </div>
  );
}
